import React from 'react'
import styled from 'styled-components'

const Container = styled.div``

const Cart = () => {
    return (
        <Container>
            <Mesaje></Mesaje>
            <Navbar></Navbar>
            <Cart></Cart>
        </Container>
    )
}

export default Cart
